(156, 'tt0460681', '8.8', 4, 17, 'Its a Terrible Life', 'In an alternate reality mysteriously created as if Sam and Dean were never brothers and have never met, Sam and Dean work at a marketing office where they are forced to team up with one another when a series of mysterious suicides point to a ghost haunting the premises.', 'https://openload.co/embed/TnofQ-2bQGc/Supernatural_-_S04E17_-_720p_BluRay_x264-Belex.mkv.mp4', 'https://streamango.com/embed/mqfeddnfnmolblcd/Supernatural_-_S04E17_-_720p_BluRay_x264-Belex_mkv_mp4'),
