(162, 'tt0460681', '9.0', 5, 1, '\rSympathy for the Devil', 'In the aftermath of the Devil rising, Sam and Dean are whisked away and they are given a message from Chuck Shurley that Castiel is dead and that Luficer walks the Earth. As a result, Sam and Dean turn to Bobby for help to find a mystical weapon, called Michael''s Sword. This will enable them to find the Devil before he takes on a new form to bring the slow end of the world. But the Winchester brothers are pitted against the archangel Zachariah who has plans for Dean, as well as more demons. Sam and Dean recognise a demon, Meg, who has returned from Hell.', 'https://openload.co/embed/yrkYkdv05IA/Supernatural_-_S05E01_-_720p_BluRay_x264-Belex.mp4', 'https://streamango.com/embed/oaaoplobfnrmfdco/Supernatural_-_S05E01_-_720p_BluRay_x264-Belex_mp4'),
(163, 'tt0460681', '8.9', 5, 2, 'Good God, Y''All', 'Rufus, an old friend of Bobby''s calls, panicked about demons attacking a town in Colorado. Sam and Dean arrive to help, but soon discover things aren''t exactly as they seem.', 'https://openload.co/embed/_YiSclMCbks/Supernatural_-_S05E02_-_720p_BluRay_x264-Belex.mp4', 'https://streamango.com/embed/nfoknaaoqlbfnmsp/Supernatural_-_S05E02_-_720p_BluRay_x264-Belex_mp4'),
(164, 'tt0460681', '8.8', 5, 3, 'Free to Be You and Me', 'Not sure he trusts himself, Sam decides to give up hunting and goes off on his own. But that night, a late-night visitor tells Sam that he won''t let him off the hook that easily. Dean, intent on stopping the Apocalypse, continues hunting on his own and teams up with Castiel to find the Archangel Raphael since Castiel believes Raphael knows the location of God''s vessel on Earth.', 'https://openload.co/embed/mFMqIdbI7o0/Supernatural_-_S05E03_-_720p_BluRay_x264-Belex.mp4', 'https://streamango.com/embed/erbsdaeeerlbokea/Supernatural_-_S05E03_-_720p_BluRay_x264-Belex_mp4'),
