(175, 'tt0460681', '9.0', 5, 14, 'My Bloody Valentine', 'A couple of days before Valentines Day, two valentines devour each other. On the next day, two lovers commit suicide. Dean and Sam investigate the murders and summon Castiel to help them. Castiel tells that the responsible is a cupid that has gone nuts. The angel brings the cupid and they conclude that he is innocent. When Sam feels hunger for demon blood, they discover that the local population has been attacked by Famine, one of the Four Horsemen of the Apocalypse.', 'https://openload.co/embed/Mot-weFKSrw/Supernatural_-_S05E14_-_720p_BluRay_x264-Belex.mp4', 'https://streamango.com/embed/bdsomnlqrokktpco/Supernatural_-_S05E14_-_720p_BluRay_x264-Belex_mp4'),
