(180, 'tt0460681', '9.1', 5, 19, 'Hammer of the Gods', 'Dean and Sam, in the midst of a long drive, stop for the night in a remote four-star hotel. Soon they learn that Kali, Baldur, Odin and other pagan gods have kidnapped the guests to eat them. Dean and Sam realize they are also trapped and being used as bargaining chips in an effort to stop the Apocalypse. Out of the blue, Gabriel arrives to warn Kali and the other gods that Lucifer will destroy them; however, it is too late since Lucifer has just arrived in the hotel.', 'https://openload.co/embed/B1CzMwGEzwA/Supernatural_-_S05E19_-_720p_BluRay_x264-Belex.mp4', 'https://streamango.com/embed/qetfqcspbfoobcpk/Supernatural_-_S05E19_-_720p_BluRay_x264-Belex_mp4'),
