(561, 'tt2193021', '8.5', 1, 3, 'Lone Gunmen', 'A mysterious sniper called Deadshot is taking out bidders at an auction for an industry company. The bidders include Oliver''s stepfather, Walter Steele.', 'https://openload.co/embed/iqTEBbC20fw/Arrow.S01E03.HDTV.x264-LOL.%5BVTV%5D.mp4', 'https://streamango.com/embed/rrmsdbbssbtktomt/Arrow_S01E03_HDTV_x264-LOL_VTV_mp4'),
