(564, 'tt2193021', '8.1', 1, 6, 'Legacies', 'Oliver''s next target is Scott Morgan, a power executive who jacks up prices for electricity when people most need it. John Diggle suggests they go after the gang of bank robbers that recently wounded a police officer during a daytime heist. Oliver is not so keen but John isn''t the kind of guy who gives up very easily. Oliver quickly identifies one of them as a high school acquaintance, Derek Reston - and learns that Reston may have turned to crime because of something Oliver''s father did. Tommy meanwhile isn''t having much luck with his hoped for romance with Laurel.', 'https://openload.co/embed/G2dnVKqXf7Q/Arrow.S01E06.HDTV.x264-LOL.%5BVTV%5D.mp4', 'https://streamango.com/embed/eklfpnctrqabbblm/Arrow_S01E06_HDTV_x264-LOL_VTV_mp4'),
