(569, 'tt2193021', '8.3', 1, 11, 'Trust But Verify', 'After a string of violent armored car robberies, Oliver suspects that Ted Gaynor of Black Hawk Security is the mastermind. His name is also on the list. It leads to a major disagreement with Digg as Gaynor was his training officer on his first tour of duty in Afghanistan. Digg learns that people change. Meanwhile, Tommy is hesitant at his father''s attempt at reconciliation - and with good reason. Thea celebrates a birthday but has trouble with the police when she''s arrested after a car accident for driving under the influence of a narcotic.', 'https://openload.co/embed/dnTfAd9WlXw/Arrow.S01E11.HDTV.x264-LOL.%5BVTV%5D.mp4', 'https://streamango.com/embed/ssqlpbsacmnkpert/Arrow_S01E11_HDTV_x264-LOL_VTV_mp4'),
(570, 'tt2193021', '8.6', 1, 12, 'Vertigo', 'After Thea gets in trouble with the police, Oliver turns to an old flame - now a vice cop - to help track down the creator of a new designer drug with lethal after-effects.', 'https://openload.co/embed/1B8fQQ-Pb7w/Arrow.S01E12.HDTV.x264-LOL.%5BVTV%5D.mp4', 'https://streamango.com/embed/pbsclscmnkfnckkt/Arrow_S01E12_HDTV_x264-LOL_VTV_mp4'),
