(572, 'tt2193021', '8.9', 1, 14, 'The Odyssey', 'Oliver''s heavy-handed approach to getting information from his mother backfires and she manages to shoot him in the shoulder. He turns to Felicity Smoak for help getting back to his hideaway. She and Digg do their best to nurse him back to health. Flashbacks to Oliver''s time on the island reveals an early attempt to escape. Oliver''s loyalties however prevent him from taking advantage of the situation. The reason for Yao Fei''s betrayal is revealed.', 'https://openload.co/embed/bl6dTmuEwIw/Arrow.S01E14.HDTV.x264-LOL.mp4', 'https://streamango.com/embed/ssceoaesrenbrcko/Arrow_S01E14_HDTV_x264-LOL_mp4'),
(573, 'tt2193021', '8.2', 1, 15, 'Dodger', 'A jewel thief named Dodger strikes Starling City, a purse snatcher targets Thea and dating anxiety hits Oliver and Diggle. Each perilous situation leads to hard choices.', 'https://openload.co/embed/W4Ub4t9sq4o/Arrow.S01E15.HDTV.x264-LOL.mp4', 'https://streamango.com/embed/cplckpqnfktllfea/Arrow_S01E15_HDTV_x264-LOL_mp4'),
(574, 'tt2193021', '8.8', 1, 16, 'Dead to Rights', 'The plan to kill Malcolm Merlyn goes into operation. Arrow kills one assassin who has just arrived in the city and retrieves his cellphone. It''s up to Felicity to break into it and find out just who the target is. A birthday dinner for Tommy Merlyn is interrupted by his father who brings him a present. Tommy makes it clear that he is not welcome and does not want a relationship with him. Malcolm is to receive an award at a civic gala and after a heart to heart with Oliver, Tommy decides to attend. When Oliver learns that Malcolm is the target, he races to save Tommy.', 'https://openload.co/embed/FYzb7FFXdm4/Arrow.S01E16.HDTV.x264-LOL.mp4', 'https://streamango.com/embed/qqqrtonqfqfpdpnb/Arrow_S01E16_HDTV_x264-LOL_mp4'),
(575, 'tt2193021', '8.3', 1, 17, 'The Huntress Returns', 'Helena is back to seek vengeance, but Oliver still has feeling toward her. The Arrow must stop and kill her, but at what costs? Now that several of his closest friends know about his true identity, no one is safe.', 'https://openload.co/embed/heRULLApOKI/Arrow.S01E17.HDTV.x264-LOL.mp4', 'https://streamango.com/embed/ftqfellfrbftbfqr/Arrow_S01E17_HDTV_x264-LOL_mp4'),
(576, 'tt2193021', '8.5', 1, 18, 'Salvation', 'After a major fire, Oliver decides it''s time to eliminate real estate developer and slumlord John Nicol, another person on his father''s list. He''s beaten to the punch when another vigilante, The Savior, who kidnaps Nicol and ultimately executes him - broadcasting the whole thing over the Internet. The new vigilante is identified as a man whose wife was killed in a bodega robbery in the Glades district. When he kidnaps Thea''s new boyfriend, Roy Harper, Oliver decides to stop him. Meanwhile, Laurel is upset to find that her father has come around to her mother''s belief', 'https://openload.co/embed/ZnDjWY5JWak/Arrow.S01E18.HDTV.x264-LOL.mp4', 'https://streamango.com/embed/nnrmbpclpfkfesdb/Arrow_S01E18_HDTV_x264-LOL_mp4'),
(577, 'tt2193021', '8.4', 1, 19, 'Unfinished Business', 'Vertigo is again appearing on the market even though The Count, who created the drug, is still in a psychiatric hospital. Soon after Oliver confirms that he''s still there, he somehow manages to escape. The Count''s psychiatrist says his patient overpowered him and has concluded that his insanity was just a ruse. The police suspect Tommy may be dealing drugs from the club and Det. Lance gets a search warrant. Oliver is not sure what to believe and Tommy, feeling his onetime friend has no respect for him, quits. He turns to his father for a job. Digg gives information ...', 'https://openload.co/embed/YajWS_cAK5Q/Arrow.S01E19.HDTV.x264-LOL.mp4', 'https://streamango.com/embed/oeekparelkbptstb/Arrow_S01E19_HDTV_x264-LOL_mp4'),
(578, 'tt2193021', '8.6', 1, 20, 'Home Invasion', 'Oliver decides that his next target is going to be someone on Digg''s list: Deadshot. They set a trap for him and Digg''s spy friends get involved as well. Meanwhile, Laurel''s latest clients are Eric and Nancy Moore who have agreed to testify against Edward Rasmus, a financial advisor who swindled them. The night before their deposition however, they are assassinated. Laurel takes charge of their now orphaned son, Taylor, but he saw his parents killed and is now the assassins next target. Oliver steps in to stop him but in doing so fails to back up Digg and Deadshot ...', 'https://openload.co/embed/ERVi8hqaN9w/Arrow.S01E20.HDTV.x264-LOL.mp4', 'https://streamango.com/embed/etspqkskssbmldat/Arrow_S01E20_HDTV_x264-LOL_mp4'),
(579, 'tt2193021', '8.9', 1, 21, 'The Undertaking', 'After taking a mob accountant''s laptop, Oliver plans to return the money to its rightful owners. Felicity however finds that Dominic Alonzo - the operator of an illegal casino and the head of a gang known for kidnapping - was paid $2 million to kidnap Walter. Arrow pays him a visit and is told that Walter is dead. He tells his mother and Thea but Moira rushes to Malcolm Merlyn demanding to know why he broke their agreement. He assures her that Walter is alive and will be released as long as she continues to cooperate. Oliver is listening to the entire conversation and...', 'https://openload.co/embed/z7g4ZBUh5k0/Arrow.S01E21.HDTV.x264-LOL.mp4', 'https://streamango.com/embed/elefaomddlkldnle/Arrow_S01E21_HDTV_x264-LOL_mp4'),
(580, 'tt2193021', '9.1', 1, 22, 'Darkness on the Edge of Town', 'The time is fast approaching for the Undertaking to occur and Malcolm Merlyn begins to tidy up the loose ends, beginning with the scientists at UNIDAC. Oliver and Digg trick Moira into telling just what the Undertaking is about. Oliver realizes that even if he manages to eliminate everyone on his father''s list he has only, in his own words, eliminated the symptoms and not the disease. Felicity locates the UNIDAC device - sort of. Thea and Roy''s relationship comes to head when they are unable to locate the vigilante. Walter files for divorce. Laurel and Oliver begin a ...', 'https://openload.co/embed/zNYbUGwTL_c/Arrow.S01E22.HDTV.x264-LOL.mp4', 'https://streamango.com/embed/tdnsdknebrndmpfs/Arrow_S01E22_HDTV_x264-LOL_mp4'),
(581, 'tt2193021', '9.5', 1, 23, 'Sacrifice', 'Oliver awakens to find himself Malcolm Merlyn''s prisoner. He manages to escape and away with help from Digg. Malcolm accelerates his timetable as a result. Felicity is questioned by Det. Lance about her hacking activities but is interrupted by Oliver who tells him about Malcolm''s plan to destroy the Glades. Tommy confronts Oliver about Laurel but refuses to believe that his father is up to no good. Malcolm comes clean about his plans and Tommy realizes that his father is insane. Moira goes public with what she knows, urging the residents of the Glades to evacuate. Roy...', 'https://openload.co/embed/vyH1OGeGhKA/Arrow.S01E23.HDTV.x264-LOL.mp4', 'https://streamango.com/embed/tsotlkoqcnaqopsd/Arrow_S01E23_HDTV_x264-LOL_mp4'),
