(583, 'tt2193021', '8.6', 2, 2, 'Identity', 'Now that Oliver no longer has the list to work from, he''s not sure what''s next. Roy continues doing his own vigilantism and has to be bailed out of jail by Thea. When he mentions to Oliver that someone is hijacking medical deliveries to the Glades Memorial hospital, the Arrow knows exactly what he wants to do. His visit to the hospital doesn''t go well when local politician Sebastian Blood takes him to task for what his family has done. When he tries to stop a hijacking, Arrow comes up against China White and her new partner Bronze Tiger. Thea tells Roy she''s not going...', 'https://openload.co/embed/vPryHX6KCIc/Arrow.S02E02.720p.HDTV.X264-DIMENSION.mkv.mp4', 'https://streamango.com/embed/tebqolqtqfaasmnp/Arrow_S02E02_720p_HDTV_X264-DIMENSION_mkv_mp4'),
