(585, 'tt2193021', '8.8', 2, 4, 'Crucible', 'Oliver discovers a man who goes by the name "The Mayor" is bringing illegal guns in to The Glades, so Oliver sponsors a "Cash for Guns" event to help clean up the city. Unfortunately, The Mayor crashes the event with his gang and seriously injures Sin. The Canary is furious when she learns her friend is in the hospital and sets out for revenge. Meanwhile, Felicity stuns Oliver with a bit of information about the Canary, Donner asks Laurel to dinner, and Diggle reconnects with an old friend.', 'https://openload.co/embed/YsT5b63ggsE/Arrow.S02E04.HDTV.x264-LOL.mp4', 'https://streamango.com/embed/ltfctoaqnmdrctdr/Arrow_S02E04_HDTV_x264-LOL_mp4'),
(586, 'tt2193021', '8.9', 2, 5, 'League of Assassins', 'While Oliver tends to the Canary''s wounds, he tries to get her to talk about where she came from but she refuses. However, after Oliver and Canary are attacked at the Queen mansion by a trained killer from the League of Assassins, she confesses to how she''s connected with the nefarious group. Meanwhile with Moira facing multiple counts of murder and conspiracy for her part in the destruction of The Glades, the Assistant District Attorney offers her a choice - plead guilty now and avoid the death penalty or take your chances in court. Thea begs her mother to fight for ...', 'https://openload.co/embed/8FoJyuvdLgY/Arrow.S02E05.720p.HDTV.X264-DIMENSION.mkv.mp4', 'https://streamango.com/embed/anempdskraapttda/Arrow_S02E05_720p_HDTV_X264-DIMENSION_mkv_mp4'),
(587, 'tt2193021', '8.6', 2, 6, 'Keep Your Enemies Closer', 'Amanda Waller sends A.R.G.U.S. agents to kidnap Diggle. Waller informs Diggle that Lyla has gone missing after following a lead on Deadshot in Moscow. When Diggle tells the team he''s headed to Russia to rescue Lyla, Oliver and Felicity decide to join, but things get messy when Isabel shows up on the tarmac and insists on joining Oliver''s "work trip". Meanwhile, Moira''s lawyer, Jean, tells Thea that dating Roy, a known criminal, is hurting her mother''s case.', 'https://openload.co/embed/sI2-EYUv9AU/arrow.S02E06.hdtv-lol.mp4', 'https://streamango.com/embed/kkkddlascpkqlatn/arrow_S02E06_hdtv-lol_mp4'),
(588, 'tt2193021', '8.7', 2, 7, 'State v. Queen', 'Oliver is concerned when a mysterious illness sweeps the city, infecting hundreds of people, including Diggle. Oliver discovers Vertigo in Diggle''s blood and realizes The Count has broken out of prison and is once again distributing his drug. Meanwhile, Moira goes on trial for her participation in the Undertaking. ADA Adam Donner collapses in court with Vertigo symptoms so Laurel must step in and try the case against Moira. Oliver is torn between standing by his family during the trial and catching The Count. However, things change when Felicity follows a lead and ...', 'https://openload.co/embed/3Pnd2-lgarI/arrow.S02E07.hdtv-lol.mp4', 'https://streamango.com/embed/dneccenlbfkldbfo/arrow_S02E07_hdtv-lol_mp4'),
