(590, 'tt2193021', '9.3', 2, 9, 'Three Ghosts', 'After a fight with Cyrus Gold, aka the Acolyte, Oliver is drugged and left for dead. Determined to cure him, Felicity makes a risky decision. The cure causes Oliver to hallucinate, and what he sees forces him to confront his past. Meanwhile, Barry Allen continues to help Felicity, and their connection grows stronger. The Arrow asks Quentin to look into Gold, but when the stakeout on Gold goes bad, someone is killed. Roy is captured and tortured by Brother Blood.', 'https://openload.co/embed/sXpi4x7NM18/Arrow.S02E09.720p.HDTV.X264-DIMENSION.mkv.mp4', 'https://streamango.com/embed/oaedesmcmrpbnmrc/Arrow_S02E09_720p_HDTV_X264-DIMENSION_mkv_mp4'),
(591, 'tt2193021', '8.5', 2, 10, 'Blast Radius', 'Oliver must tackle a new threat to the city when bombs start to go off in Starling City. Felicity discovers the person setting them off is Mark Scheffer, a man who goes by the nickname Shrapnel. The Arrow discovers Shrapnel''s next target is Sebastian Blood''s "Unity Rally" and tries to talk the alderman out of hosting it, but he refuses. The Arrow sets off to stop the bombing, but Shrapnel tricks him and traps him in a bomb-laced antique store where he is unable to move without setting off the device. While Felicity helps Oliver, Diggle races to the plaza to find the ...', 'https://openload.co/embed/w-DKfoQSpYY/Arrow.S02E10.720p.HDTV.X264-DIMENSION.mkv.mp4', 'https://streamango.com/embed/pqcrsblnndcnpqfc/Arrow_S02E10_720p_HDTV_X264-DIMENSION_mkv_mp4'),
(592, 'tt2193021', '8.7', 2, 11, 'Blind Spot', 'Oliver is conflicted after Laurel reaches out to the Arrow asking him to investigate Sebastian Blood. Oliver is unsure whether to believe her accusations against the man he has publicly supported for mayor, but decides to trust Laurel. However, when the pair gets too close to the truth, Sebastian exposes Laurel''s drug addiction and has her arrested. Meanwhile, Roy reveals his new super-strength to Sin who wants to test out his abilities. Unfortunately, Roy isn''t able to contain his rage once unleashed and almost kills a man. Back on the island, Oliver is surprised ...', 'https://openload.co/embed/2wbuGn0O0Nw/Arrow.S02E11.HDTV.x264-LOL.mp4', 'https://streamango.com/embed/snkamkaeqonmsorq/Arrow_S02E11_HDTV_x264-LOL_mp4'),
(593, 'tt2193021', '8.8', 2, 12, 'Tremors', 'Arrow offers to train Roy so he can learn to control his newfound super-strength. However, Roy is a rebellious student and refuses to listen unless Arrow reveals his true identity, which Oliver refuses to do. Meanwhile, the Bronze Tiger escapes from prison and steals Malcolm''s earthquake machine to sell to the highest bidder. Oliver, Diggle and Felicity attempt to stop the transfer, but Roy gets in the way, putting everyone in danger. Laurel is disbarred and spirals out of control. Moira is thrilled when Walter asks her to dinner, but his reason surprises her. Thea ...', 'https://openload.co/embed/ul9a_CXg2Q8/Arrow.S02E12.720p.HDTV.X264-DIMENSION.mkv.mp4', 'https://streamango.com/embed/ktssndoqoearbkel/Arrow_S02E12_720p_HDTV_X264-DIMENSION_mkv_mp4'),
(594, 'tt2193021', '8.8', 2, 13, 'Heir to the Demon', 'Laurel continues to unravel, Oliver and Lance try to convince Sara to stay in Starling City and finally reunite with Laurel and Dinah. However, Sara''s fellow League of Assassins member, Nyssa, comes to bring Sara back to the fold, but when Sara refuses, Nyssa kidnaps Dinah. Realizing she''s putting her family in danger by staying in town, Sara considers re-joining the league.', 'https://openload.co/embed/gQre_lS5lI4/Arrow.S02E13.720p.HDTV.X264-DIMENSION.mkv.mp4', 'https://streamango.com/embed/erpcbmsqkcsnetcp/Arrow_S02E13_720p_HDTV_X264-DIMENSION_mkv_mp4'),
(595, 'tt2193021', '8.9', 2, 14, 'Time of Death', 'Oliver brings Sara into the Arrow team. Watching Oliver and Diggle spar with Sara and talk old scars, Felicity starts to feel left out. The team is investigating a villain named William Tockman, a.k.a. The Clock King, who is a brilliant thief armed with technology that can open any bank vault in Starling City. After The Clock King infiltrates the computer systems in the lair, Felicity feels pressure to prove her worth. When she gets a lead on Tockman''s whereabouts, she heads out without the team, putting her in peril. Meanwhile, Oliver throws Sara a welcome home party...', 'https://openload.co/embed/zuBvwWJ54us/Arrow.S02E14.720p.HDTV.X264-DIMENSION.mkv.mp4', 'https://streamango.com/embed/brcdocptcktktmfa/Arrow_S02E14_720p_HDTV_X264-DIMENSION_mkv_mp4'),
(596, 'tt2193021', '9.2', 2, 15, 'The Promise', 'Oliver is shocked when he learns that Slade has come to Starling City. Back on the island, as Oliver, Slade and Sara prepare to take over the freighter from Ivo, Sara pulls Oliver aside and tells him he needs to kill Ivo to prevent him from telling Slade what happened with Shado. Oliver feels immense guilt over the situation but realizes Slade''s growing rage from the Mirakuru makes him unpredictable and he could turn on his friends if he thinks Oliver is to blame. Oliver agrees to kill Ivo and the battle begins.', 'https://openload.co/embed/N5mCgczkPKo/Arrow.S02E15.720p.HDTV.X264-DIMENSION.mkv.mp4', 'https://streamango.com/embed/sqeleqcdlabnlede/Arrow_S02E15_720p_HDTV_X264-DIMENSION_mkv_mp4'),
(597, 'tt2193021', '8.7', 2, 16, 'Suicide Squad', 'Lyla asks Diggle to go on a mission alongside the Suicide Squad, a team assembled by Amanda Waller to undertake high-risk missions, even though the team includes Diggle''s nemesis, Deadshot, and Oliver''s enemy, Bronze Tiger.', 'https://openload.co/embed/_XwewdE35x4/Arrow.S02E16.720p.HDTV.X264-DIMENSION.mkv.mp4', 'https://streamango.com/embed/ombqqndqcserleqc/Arrow_S02E16_720p_HDTV_X264-DIMENSION_mkv_mp4'),
(598, 'tt2193021', '8.4', 2, 17, 'Birds of Prey', 'When Frank Bertinelli is arrested, Oliver knows it''s only a matter of time before his daughter, Helena, AKA The Huntress, returns to town. To make matters worse, Laurel is picked to try Frank''s case, putting her right in the path of Helena. Oliver tells Sara he will handle his ex-girlfriend, but when Helena takes hostages at the courthouse, including Laurel, the Canary will stop at nothing to save her sister. When The Huntress and Canary meet, an epic battle begins. Meanwhile, Roy realizes he needs to keep Thea safe, but doesn''t like the way he is forced to go about ...', 'https://openload.co/embed/bE7lwawGEGc/Arrow.S02E17.720p.HDTV.X264-DIMENSION.mkv.mp4', 'https://streamango.com/embed/nttbpqaqdarmpsfn/Arrow_S02E17_720p_HDTV_X264-DIMENSION_mkv_mp4'),
(599, 'tt2193021', '9.3', 2, 18, 'Deathstroke', 'After taking a ride home from Slade, Thea becomes his prisoner. Can Oliver and his friends save her? Also, someone close to Oliver is working for Slade, since his return from the Island after Tommy''s death.', 'https://openload.co/embed/_qf2m8IxMj4/Arrow.S02E18.720p.HDTV.x264-DIMENSION.mkv.mp4', 'https://streamango.com/embed/abcpofrmrppmnrkq/Arrow_S02E18_720p_HDTV_x264-DIMENSION_mkv_mp4'),
(600, 'tt2193021', '9.1', 2, 19, 'The Man Under the Hood', 'Oliver, Canary, Diggle, and Felicity return to the lair and find Slade waiting for them. An epic battle breaks out and one member of Team Arrow is sent to the hospital. Thea hits her breaking point, but just as Oliver is about to reach her, Slade intervenes and Oliver is faced with a choice - his battle with Slade or his family. Meanwhile, Laurel struggles with a new secret.', 'https://openload.co/embed/t-uGSZEu3Ns/Arrow.S02E19.720p.HDTV.X264-DIMENSION.mkv.mp4', 'https://streamango.com/embed/ftnaorrfetlcfsce/Arrow_S02E19_720p_HDTV_X264-DIMENSION_mkv_mp4'),
(601, 'tt2193021', '9.4', 2, 20, 'Seeing Red', 'The mirakuru sends Roy into a rage rampage across the city. Sara thinks that the only way to stop him is to kill him but Oliver thinks he can still save him. Meanwhile, Slade is continuing his plan to make Oliver pay.', 'https://openload.co/embed/sc9bzzMBvLo/Arrow.S02E20.720p.HDTV.X264-DIMENSION.mkv.mp4', 'https://streamango.com/embed/sbbptpebqopdcqca/Arrow_S02E20_720p_HDTV_X264-DIMENSION_mkv_mp4'),
(602, 'tt2193021', '9.1', 2, 21, 'City of Blood', 'After Slade threatens to take everything Oliver loves away, Oliver decides the fastest way to stop further bloodshed is to surrender to his enemy. Knowing that surrender will surely lead to Oliver''s death, Diggle and Felicity go to extreme measures to keep Oliver from confronting Slade. Meanwhile, Thea considers leaving town, and Laurel resumes her crusade against Sebastian Blood. Finally, Slade unleashes his assault on Starling City.', 'https://openload.co/embed/d41tx-9G5xg/Arrow.S02E21.720p.HDTV.X264-DIMENSION.mkv.mp4', 'https://streamango.com/embed/ttoamssdrcqeqtbl/Arrow_S02E21_720p_HDTV_X264-DIMENSION_mkv_mp4'),
(603, 'tt2193021', '9.3', 2, 22, 'Streets of Fire', 'Oliver rallies his team as Slade''s soldiers attack the city. Felicity gets a call from S.T.A.R. Labs with game-changing news and Thea comes face-to-face with her father.', 'https://openload.co/embed/irvzhb5gVh4/Arrow.S02E22.720p.HDTV.X264-DIMENSION.mkv.mp4', 'https://streamango.com/embed/asokkssdomloaodl/Arrow_S02E22_720p_HDTV_X264-DIMENSION_mkv_mp4'),
(604, 'tt2193021', '9.5', 2, 23, 'Unthinkable', 'As Oliver''s face off with Slade escalates, his resolve to the no-kill rule is tested. Especially as Slade targets the woman Oliver loves.', 'https://openload.co/embed/kZrmD1nfmSc/Arrow.S02E23.720p.HDTV.X264-DIMENSION.mkv.mp4', 'https://streamango.com/embed/rfqbnfqsbpeocdkt/Arrow_S02E23_720p_HDTV_X264-DIMENSION_mkv_mp4');
